  "translationLines": [
    {
      "lineNumber": 97041,
      "originalJapaneseLine": "「今の発言、聞かなかったことにします」",
      "translatedEnglishLine": "\"I will pretend I didn't hear what you just said.\""
    },
    {
      "lineNumber": 97042,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"......\""
    },
    {
      "lineNumber": 97043,
      "originalJapaneseLine": "「三日後の夜、西の森で待つわ。",
      "translatedEnglishLine": "\"I'll wait in the western forest three nights from now."
    },
    {
      "lineNumber": 97044,
      "originalJapaneseLine": "　それまでに答えを決めて」",
      "translatedEnglishLine": "Decide your answer by then.\""
    },
    {
      "lineNumber": 97045,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"......\""
    },
    {
      "lineNumber": 97046,
      "originalJapaneseLine": "それから三日間、",
      "translatedEnglishLine": "For the next three days,"
    },
    {
      "lineNumber": 97047,
      "originalJapaneseLine": "闇郭公と闇鷺はアサシンとは思えぬ、",
      "translatedEnglishLine": "Dark Cuckoo and Dark Heron, unthinkable as assassins,"
    },
    {
      "lineNumber": 97048,
      "originalJapaneseLine": "穏やかな日々を――恋人として過ごした。",
      "translatedEnglishLine": "spent peaceful days—as lovers."
    },
    {
      "lineNumber": 97049,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "......"
    },
    {
      "lineNumber": 97050,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 97051,
      "originalJapaneseLine": "三日後の夜――",
      "translatedEnglishLine": "The night three days later――"
    },
    {
      "lineNumber": 97052,
      "originalJapaneseLine": "「……来たわね」",
      "translatedEnglishLine": "\"...You've come.\""
    },
    {
      "lineNumber": 97053,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"......\""
    },
    {
      "lineNumber": 97054,
      "originalJapaneseLine": "街の西の森、",
      "translatedEnglishLine": "In the western forest of the town,"
    },
    {
      "lineNumber": 97055,
      "originalJapaneseLine": "闇郭公のもとに闇鷺が姿を見せた。",
      "translatedEnglishLine": "Dark Heron appeared before Dark Cuckoo."
    },
    {
      "lineNumber": 97056,
      "originalJapaneseLine": "「ありがとう、貴方なら",
      "translatedEnglishLine": "\"Thank you, I knew you"
    },
    {
      "lineNumber": 97057,
      "originalJapaneseLine": "　一緒に来てくれると思った」",
      "translatedEnglishLine": "would come with me.\""
    },
    {
      "lineNumber": 97058,
      "originalJapaneseLine": "「さあ、どこに逃げましょうか」",
      "translatedEnglishLine": "\"Now, where shall we run?\""
    },
    {
      "lineNumber": 97059,
      "originalJapaneseLine": "「近づかないで下さい」",
      "translatedEnglishLine": "\"Don't come any closer.\""
    },
    {
      "lineNumber": 97060,
      "originalJapaneseLine": "両手を広げて近づく闇郭公に対し、",
      "translatedEnglishLine": "Dark Cuckoo approached with arms wide open,"
    },
    {
      "lineNumber": 97061,
      "originalJapaneseLine": "闇鷺が武器を構え機先を制した。",
      "translatedEnglishLine": "but Dark Heron took the initiative by drawing her weapon."
    },
    {
      "lineNumber": 97062,
      "originalJapaneseLine": "「……闇の翼の掟は知っていますね？」",
      "translatedEnglishLine": "\"...You know the laws of the Dark Wings, don't you?\""
    },
    {
      "lineNumber": 97063,
      "originalJapaneseLine": "「裏切り者には死を」",
      "translatedEnglishLine": "\"Death to traitors.\""
    },
    {
      "lineNumber": 97064,
      "originalJapaneseLine": "「私と貴方、どちらの方が強いかは",
      "translatedEnglishLine": "\"You know well which of us is stronger—"
    },
    {
      "lineNumber": 97065,
      "originalJapaneseLine": "　分かっているでしょう……",
      "translatedEnglishLine": "—I think you understand that...\""
    },
    {
      "lineNumber": 97066,
      "originalJapaneseLine": "　抵抗は無意味です」",
      "translatedEnglishLine": "\"Resistance is pointless.\""
    },
    {
      "lineNumber": 97067,
      "originalJapaneseLine": "「そんな……私を殺すつもり？",
      "translatedEnglishLine": "\"No way... you intend to kill me?"
    },
    {
      "lineNumber": 97068,
      "originalJapaneseLine": "　貴方が、この私を？」",
      "translatedEnglishLine": "You, killing me?\""
    },
    {
      "lineNumber": 97069,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"......\""
    },
    {
      "lineNumber": 97070,
      "originalJapaneseLine": "「動かないで下さい。",
      "translatedEnglishLine": "\"Don't move."
    },
    {
      "lineNumber": 97071,
      "originalJapaneseLine": "　動かなければ……即死させられます」",
      "translatedEnglishLine": "If you don't, I can kill you instantly.\""
    },
    {
      "lineNumber": 97072,
      "originalJapaneseLine": "「……せめて、痛みなく送らせて下さい」",
      "translatedEnglishLine": "\"...At least, let me send you off without pain.\""
    },
    {
      "lineNumber": 97073,
      "originalJapaneseLine": "「そう……」",
      "translatedEnglishLine": "\"I see...\""
    },
    {
      "lineNumber": 97074,
      "originalJapaneseLine": "「…………試験は合格よ、闇鷺」",
      "translatedEnglishLine": "\"...You passed the test, Dark Heron.\""
    },
    {
      "lineNumber": 97075,
      "originalJapaneseLine": "「――ッ！？　ガッ、ハッ！？」",
      "translatedEnglishLine": "\"—!? Gah, hah!?\""
    },
    {
      "lineNumber": 97076,
      "originalJapaneseLine": "音も気配もなく、",
      "translatedEnglishLine": "Without sound or presence,"
    },
    {
      "lineNumber": 97077,
      "originalJapaneseLine": "目にも止まらぬ速度で",
      "translatedEnglishLine": "at a speed too fast to see,"
    },
    {
      "lineNumber": 97078,
      "originalJapaneseLine": "背後に移動した闇郭公が闇鷺の首を掴んできた。",
      "translatedEnglishLine": "Dark Cuckoo moved behind and grabbed Dark Heron's neck."
    },
    {
      "lineNumber": 97079,
      "originalJapaneseLine": "（そんな……この人……！",
      "translatedEnglishLine": "(No way... this person...!)"
    },
    {
      "lineNumber": 97080,
      "originalJapaneseLine": "　今までずっと、実力を、隠し、て……！）",
      "translatedEnglishLine": "All this time, hiding their true strength...!)"
    },
    {
      "lineNumber": 97081,
      "originalJapaneseLine": "首筋にかけられた手の力が、",
      "translatedEnglishLine": "The grip on my neck"
    },
    {
      "lineNumber": 97082,
      "originalJapaneseLine": "万力のようにギリギリと、徐々に強くなる。",
      "translatedEnglishLine": "tightened like a vise, steadily increasing."
    },
    {
      "lineNumber": 97083,
      "originalJapaneseLine": "（ま、まずい、このまま、じゃ……！）",
      "translatedEnglishLine": "(T-this is bad, at this rate...!)"
    },
    {
      "lineNumber": 97084,
      "originalJapaneseLine": "「ごめんなさいね、",
      "translatedEnglishLine": "\"I'm sorry,"
    },
    {
      "lineNumber": 97085,
      "originalJapaneseLine": "　頭領と構成員の間を取り持つ連絡員、闇郭公、",
      "translatedEnglishLine": "Dark Cuckoo, the messenger between the leader and the members,"
    },
    {
      "lineNumber": 97086,
      "originalJapaneseLine": "　それは偽りの姿なの……」",
      "translatedEnglishLine": "is a false identity...\""
    },
    {
      "lineNumber": 97087,
      "originalJapaneseLine": "「……割と気に入っていたけど、",
      "translatedEnglishLine": "\"...I quite liked it, but"
    },
    {
      "lineNumber": 97088,
      "originalJapaneseLine": "　貴方との恋人ごっこも今日でおしまいね」",
      "translatedEnglishLine": "the pretend relationship with you ends today.\""
    },
    {
      "lineNumber": 97089,
      "originalJapaneseLine": "（ご、っ、こ……？）",
      "translatedEnglishLine": "(Pre-tense...?)"
    },
    {
      "lineNumber": 97090,
      "originalJapaneseLine": "「私個人に対して強い情を持ちながら……",
      "translatedEnglishLine": "\"While you harbored strong feelings towards me personally..."
    }
  ]
}

